import React, { useState } from "react";
import { ThemeProvider, useTheme } from '@mui/material/styles';
import {
  AppBar, Box, Toolbar, Typography, MenuItem, Link, IconButton, Menu, TextField, InputAdornment,
  Paper
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Sidebar from '../SideBar/SideBar'; // Assurez-vous que le chemin est correct

const pages = ['Datasets', 'Top Stocks', 'Stock Alerts', 'AI Stock Picks'];

export default function Layout({ children }) {
    const theme = useTheme();
    const [anchorEl, setAnchorEl] = useState(null);
    const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = useState(null);
    const [sidebarOpen, setSidebarOpen] = useState(false); // Ajout de l'état pour Sidebar

    const isMenuOpen = Boolean(anchorEl);

    const handleProfileMenuOpen = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleMobileMenuClose = () => {
        setMobileMoreAnchorEl(null);
    };

    const handleMenuClose = () => {
        setAnchorEl(null);
        handleMobileMenuClose();
    };

    const toggleSidebar = () => { // Contrôle l'ouverture/fermeture de la Sidebar
        setSidebarOpen(!sidebarOpen);
    };

    const menuId = 'primary-search-account-menu';
    const renderMenu = (
        <Menu
            anchorEl={anchorEl}
            anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
            }}
            id={menuId}
            keepMounted
            transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
            }}
            open={isMenuOpen}
            onClose={handleMenuClose}
        >
            <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose}>My account</MenuItem>
            <MenuItem onClick={handleMenuClose}>Logout</MenuItem>
        </Menu>
    );

    return (
        <ThemeProvider theme={theme}>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static">
                    <Toolbar>
                        <IconButton
                            size="large"
                            edge="start"
                            color="inherit"
                            aria-label="open drawer"
                            onClick={toggleSidebar} // Modification ici pour gérer la Sidebar
                            sx={{ mr: 2 }}
                        >
                            <MenuIcon />
                        </IconButton>
                        <TextField
                            variant="outlined"
                            placeholder="Search Stocks & Crypto"
                            sx={{ flex: 1 }}
                            InputProps={{
                                startAdornment: (
                                    <InputAdornment position="start">
                                        <SearchIcon />
                                    </InputAdornment>
                                ),
                            }}
                        />
                        {pages.map((page) => (
                            <MenuItem key={page} sx={{ color: 'WHITE', display: 'block' }}>
                                <Link to={`/${page.toLowerCase().replace(/\s+/g, '')}`} color="inherit">
                                    {page}
                                </Link>
                            </MenuItem>
                        ))}
                        <Box sx={{ flexGrow: 1 }} />
                        <IconButton
                            edge="end"
                            aria-label="account of current user"
                            aria-controls={menuId}
                            aria-haspopup="true"
                            onClick={handleProfileMenuOpen}
                            color="inherit"
                        >
                            <AccountCircle />
                        </IconButton>
                    </Toolbar>
                </AppBar>
                {renderMenu}
                <Sidebar open={sidebarOpen} onClose={toggleSidebar} /> {/* Intégration de la Sidebar */}
            </Box>
            <Box>
            
                <Gridcontainer > <Paper>
                    {children}  
              </Paper>   </Gridcontainer>
          
            
            </Box>
     
        </ThemeProvider>
    );
}
